import React from "react";

const ContactCard = ({ contact }) => {
  const { firstname, lastname, email, profession, gender, bio, url } = contact;
  return (
    <div>
      <div class=" dark:bg-gray-900 flex flex-wrap items-center justify-center">
        <div class="container max-w-lg bg-white rounded dark:bg-gray-800 shadow-lg transform duration-200 easy-in-out m-12">
          <div class="flex px-5 -mt-12 mb-5">
            <div class="h-32 w-32 rounded-lg">
              <img alt={firstname} src={url} />
            </div>
          </div>
          <div class="">
            <div class="px-7 mb-8">
              <h2 class="text-3xl font-bold text-green-800 dark:text-gray-300">
                {firstname + " " + lastname}
              </h2>
              <p class="text-gray-400 mt-2 dark:text-gray-400">{profession}</p>
              <p class="mt-2 text-gray-600 dark:text-gray-300">{bio}</p>
              <div class="">{email}</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactCard;
